INSERT INTO `movie_processor_movie` VALUES (1, 'https://m.media-amazon.com/images/M/MV5BM2MyNjYxNmUtYTAwNi00MTYxLWJmNWYtYzZlODY3ZTk3OTFlXkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Godfather', '9.6', '1972', '1421842', 'Francis Ford Coppola', 'Marlon Brando,Al Pacino,James Caan', '2h55min', 'Crime,Drama', 'When the aging head of a famous crime family decides to transfer his position to one of his subalterns, a series of unfortunate events start happening to the family, and a war begins between all the well-known families leading to insolence, deportation, murder and revenge, and ends with the favorable successor being finally chosen.', 'www.youtube.com/embed/5DO-nDW43Ik');
INSERT INTO `movie_processor_movie` VALUES (2, 'https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Godfather: Part II', '9.0', '1974', '986708', 'Francis Ford Coppola', 'Al Pacino,Robert De Niro,Robert Duvall', '3h22min', 'Crime,Drama', 'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba.', 'www.youtube.com/embed/9O1Iy9od7-A');
INSERT INTO `movie_processor_movie` VALUES (3, 'https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@.jpg', 'The Dark Knight', '9.0', '2008', '2038176', 'Christopher Nolan', 'Christian Bale,Heath Ledger,Aaron Eckhart', '2h32min', 'Action,Crime,Drama', 'Set within a year after the events of Batman Begins, Batman, Lieutenant James Gordon, and new district attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City until a mysterious and sadistic criminal mastermind known only as the Joker appears in Gotham, creating a new wave of chaos. Batman\'s struggle against the Joker becomes deeply personal, forcing him to \"confr', 'www.youtube.com/embed/EXeTwQWrcwY');
INSERT INTO `movie_processor_movie` VALUES (4, 'https://m.media-amazon.com/images/M/MV5BMWU4N2FjNzYtNTVkNC00NzQ0LTg0MjAtYTJlMjFhNGUxZDFmXkEyXkFqcGdeQXVyNjc1NTYyMjg@.jpg', '12 Angry Men', '8.9', '1957', '585319', 'Sidney Lumet', 'Henry Fonda,Lee J. Cobb,Martin Balsam', '1h36min', 'Drama', 'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young man is guilty or innocent of murdering his father. What begins as an open-and-shut case of murder soon becomes a detective story that presents a succession of clues creating doubt, and a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each oth', 'www.youtube.com/embed/_13J_9B5jEk');
INSERT INTO `movie_processor_movie` VALUES (5, 'https://m.media-amazon.com/images/M/MV5BNDE4OTMxMTctNmRhYy00NWE2LTg3YzItYTk3M2UwOTU5Njg4XkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'Schindler\'s List', '8.9', '1993', '1073928', 'Steven Spielberg', 'Liam Neeson,Ralph Fiennes,Ben Kingsley', '3h15min', 'Biography,Drama,History', 'Oskar Schindler is a vainglorious and greedy German businessman who becomes an unlikely humanitarian amid the barbaric German Nazi reign when he feels compelled to turn his factory into a refuge for Jews. Based on the true story of Oskar Schindler who managed to save about 1100 Jews from being gassed at the Auschwitz concentration camp, it is a testament to the good in all of us.', 'www.youtube.com/embed/gG22XNhtnoY');
INSERT INTO `movie_processor_movie` VALUES (6, 'https://m.media-amazon.com/images/M/MV5BNzA5ZDNlZWMtM2NhNS00NDJjLTk4NDItYTRmY2EwMWZlMTY3XkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Lord of the Rings: The Return of the King', '8.9', '2003', '1475213', 'Peter Jackson', 'Elijah Wood,Viggo Mortensen,Ian McKellen', '3h21min', 'Adventure,Drama,Fantasy', 'The final confrontation between the forces of good and evil fighting for control of the future of Middle-earth. Frodo and Sam reach Mordor in their quest to destroy the One Ring, while Aragorn leads the forces of good against Sauron\'s evil army at the stone city of Minas Tirith.', 'www.youtube.com/embed/r5X-hFf6Bwo');
INSERT INTO `movie_processor_movie` VALUES (7, 'https://m.media-amazon.com/images/M/MV5BNGNhMDIzZTUtNTBlZi00MTRlLWFjM2ItYzViMjE3YzI5MjljXkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'Pulp Fiction', '8.9', '1994', '1620497', 'Quentin Tarantino', 'John Travolta,Uma Thurman,Samuel L. Jackson', '2h34min', 'Crime,Drama', 'Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose hi', 'www.youtube.com/embed/s7EdQ4FqbhY');
INSERT INTO `movie_processor_movie` VALUES (8, 'https://m.media-amazon.com/images/M/MV5BOTQ5NDI3MTI4MF5BMl5BanBnXkFtZTgwNDQ4ODE5MDE@.jpg', 'The Good, the Bad and the Ugly', '9.0', '1966', '615029', 'Sergio Leone', 'Clint Eastwood,Eli Wallach,Lee Van Cleef', '2h58min', 'Western', 'Blondie (The Good) is a professional gunslinger who is out trying to earn a few dollars. Angel Eyes (The Bad) is a hit man who always commits to a task and sees it through, as long as he is paid to do so. And Tuco (The Ugly) is a wanted outlaw trying to take care of his own hide. Tuco and Blondie share a partnership together making money off Tuco\'s bounty, but when Blondie unties the partnership, ', 'www.youtube.com/embed/WCN5JJY_wiA');
INSERT INTO `movie_processor_movie` VALUES (9, 'https://m.media-amazon.com/images/M/MV5BMjJmYTNkNmItYjYyZC00MGUxLWJhNWMtZDY4Nzc1MDAwMzU5XkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'Fight Club', '8.8', '1999', '1658236', 'David Fincher', 'Brad Pitt,Edward Norton,Meat Loaf', '2h19min', 'Drama', 'A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making s', 'www.youtube.com/embed/qtRKdVHc-cE');
INSERT INTO `movie_processor_movie` VALUES (10, 'https://m.media-amazon.com/images/M/MV5BN2EyZjM3NzUtNWUzMi00MTgxLWI0NTctMzY4M2VlOTdjZWRiXkEyXkFqcGdeQXVyNDUzOTQ5MjY@.jpg', 'The Lord of the Rings: The Fellowship of the Ring', '8.8', '2001', '1491773', 'Peter Jackson', 'Elijah Wood,Ian McKellen,Orlando Bloom', '2h58min', 'Adventure,Drama,Fantasy', 'An ancient Ring thought lost for centuries has been found, and through a strange twist of fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it. However, he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Bor', 'www.youtube.com/embed/V75dMMIW2B4');
INSERT INTO `movie_processor_movie` VALUES (11, 'https://m.media-amazon.com/images/M/MV5BNWIwODRlZTUtY2U3ZS00Yzg1LWJhNzYtMmZiYmEyNmU1NjMzXkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'Forrest Gump', '8.8', '1994', '1588529', 'Robert Zemeckis', 'Tom Hanks,Robin Wright,Gary Sinise', '2h22min', 'Drama,Romance', 'Forrest Gump is a simple man with a low I.Q. but good intentions. He is running through childhood with his best and only friend Jenny. His \'mama\' teaches him the ways of life and leaves him to choose his destiny. Forrest joins the army for service in Vietnam, finding new friends called Dan and Bubba, he wins medals, creates a famous shrimp fishing fleet, inspires people to jog, starts a ping-pong ', 'www.youtube.com/embed/bLvqoHBptjg');
INSERT INTO `movie_processor_movie` VALUES (12, 'https://m.media-amazon.com/images/M/MV5BYmU1NDRjNDgtMzhiMi00NjZmLTg5NGItZDNiZjU5NTU4OTE0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'Star Wars: Episode V - The Empire Strikes Back', '8.7', '1980', '1039775', 'Irvin Kershner', 'Mark Hamill,Harrison Ford,Carrie Fisher', '2h4min', 'Action,Adventure,Fantasy', 'Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi Master\'s help will Luke survive when the Dark Side of the Force beckons him into the ultimate duel with Darth Vader.', 'www.youtube.com/embed/JNwNXF9Y6kY');
INSERT INTO `movie_processor_movie` VALUES (13, 'https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@.jpg', 'Inception', '8.8', '2010', '1816795', 'Christopher Nolan', 'Leonardo DiCaprio,Joseph Gordon-Levitt,Ellen Page', '2h28min', 'Action,Adventure,Sci-Fi', 'Dom Cobb is a skilled thief, the absolute best in the dangerous art of extraction, stealing valuable secrets from deep within the subconscious during the dream state, when the mind is at its most vulnerable. Cobb\'s rare ability has made him a coveted player in this treacherous new world of corporate espionage, but it has also made him an international fugitive and cost him everything he has ever l', 'www.youtube.com/embed/YoHD9XEInc0');
INSERT INTO `movie_processor_movie` VALUES (14, 'https://m.media-amazon.com/images/M/MV5BNGE5MzIyNTAtNWFlMC00NDA2LWJiMjItMjc4Yjg1OWM5NzhhXkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Lord of the Rings: The Two Towers', '8.7', '2002', '1334165', 'Peter Jackson', 'Elijah Wood,Ian McKellen,Viggo Mortensen', '2h59min', 'Adventure,Drama,Fantasy', 'The continuing quest of Frodo and the Fellowship to destroy the One Ring. Frodo and Sam discover they are being followed by the mysterious Gollum. Aragorn, the Elf archer Legolas, and Gimli the Dwarf encounter the besieged Rohan kingdom, whose once great King Theoden has fallen under Saruman\'s deadly spell.', 'www.youtube.com/embed/LbfMDwc4azU');
INSERT INTO `movie_processor_movie` VALUES (15, 'https://m.media-amazon.com/images/M/MV5BZjA0OWVhOTAtYWQxNi00YzNhLWI4ZjYtNjFjZTEyYjJlNDVlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'One Flew Over the Cuckoo\'s Nest', '8.7', '1975', '822016', 'Milos Forman', 'Jack Nicholson,Louise Fletcher,Will Sampson', '2h13min', 'Drama', 'McMurphy has a criminal past and has once again gotten himself into trouble and is sentenced by the court. To escape labor duties in prison, McMurphy pleads insanity and is sent to a ward for the mentally unstable. Once here, McMurphy both endures and stands witness to the abuse and degradation of the oppressive Nurse Ratched, who gains superiority and power through the flaws of the other inmates.', 'www.youtube.com/embed/OXrcDonY-B8');
INSERT INTO `movie_processor_movie` VALUES (16, 'https://m.media-amazon.com/images/M/MV5BY2NkZjEzMDgtN2RjYy00YzM1LWI4ZmQtMjIwYjFjNmI3ZGEwXkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'Goodfellas', '9.4', '1990', '894726', 'Martin Scorsese', 'Robert De Niro,Ray Liotta,Joe Pesci', '2h26min', 'Biography,Crime,Drama', 'Henry Hill might be a small time gangster, who may have taken part in a robbery with Jimmy Conway and Tommy De Vito, two other gangsters who might have set their sights a bit higher. His two partners could kill off everyone else involved in the robbery, and slowly start to think about climbing up through the hierarchy of the Mob. Henry, however, might be badly affected by his partners\' success, bu', 'www.youtube.com/embed/qo5jJpHtI1Y');
INSERT INTO `movie_processor_movie` VALUES (17, 'https://m.media-amazon.com/images/M/MV5BNzQzOTk3OTAtNDQ0Zi00ZTVkLWI0MTEtMDllZjNkYzNjNTc4L2ltYWdlXkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'The Matrix', '8.7', '1999', '1488600', 'Lana Wachowski', 'Keanu Reeves,Laurence Fishburne,Carrie-Anne Moss', '2h16min', 'Action,Sci-Fi', 'Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a hacker known as Neo. Neo has always questioned his reality, but the truth is far beyond his imagination. Neo finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker branded a terrorist by the government. Morpheus awakens Neo to the real world, a ravage', 'www.youtube.com/embed/vKQi3bBA1y8');
INSERT INTO `movie_processor_movie` VALUES (18, 'https://m.media-amazon.com/images/M/MV5BMTc5MDY1MjU5MF5BMl5BanBnXkFtZTgwNDM2OTE4MzE@.jpg', 'Seven Samurai', '8.7', '1954', '279943', 'Akira Kurosawa', 'Toshirô Mifune,Takashi Shimura,Keiko Tsushima', '3h27min', 'Adventure,Drama', 'A veteran samurai, who has fallen on hard times, answers a village\'s request for protection from bandits. He gathers 6 other samurai to help him, and they teach the townspeople how to defend themselves, and they supply the samurai with three small meals a day. The film culminates in a giant battle when 40 bandits attack the village.', 'www.youtube.com/embed/bBfgNpSQm3I');
INSERT INTO `movie_processor_movie` VALUES (19, 'https://m.media-amazon.com/images/M/MV5BOTUwODM5MTctZjczMi00OTk4LTg3NWUtNmVhMTAzNTNjYjcyXkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'Se7en', '8.6', '1995', '1271093', 'David Fincher', 'Morgan Freeman,Brad Pitt,Kevin Spacey', '2h7min', 'Crime,Drama,Mystery', 'A film about two homicide detectives\' (Morgan Freeman and Brad Pitt) desperate hunt for a serial killer who justifies his crimes as absolution for the world\'s ignorance of the Seven Deadly Sins. The movie takes us from the tortured remains of one victim to the next as the sociopathic \"John Doe\" (Kevin Spacey) sermonizes to Detectives Somerset and Mills -- one sin at a time. The sin of Gluttony com', 'www.youtube.com/embed/znmZoVkCjpI');
INSERT INTO `movie_processor_movie` VALUES (20, 'https://m.media-amazon.com/images/M/MV5BMGU5OWEwZDItNmNkMC00NzZmLTk1YTctNzVhZTJjM2NlZTVmXkEyXkFqcGdeQXVyMTMxODk2OTU@.jpg', 'City of God', '8.8', '2002', '637569', 'Fernando Meirelles', 'Alexandre Rodrigues,Leandro Firmino,Matheus Nachtergaele', '2h10min', 'Crime,Drama', 'Brazil, 1960s, City of God. The Tender Trio robs motels and gas trucks. Younger kids watch and learn well...too well. 1970s: Li\'l Zé has prospered very well and owns the city. He causes violence and fear as he wipes out rival gangs without mercy. His best friend Bené is the only one to keep him on the good side of sanity. Rocket has watched these two gain power for years, and he wants no part of i', 'www.youtube.com/embed/dcUOO4Itgmw');
