INSERT INTO `movie_processor_movie` VALUES (116, 'https://m.media-amazon.com/images/M/MV5BZDFmNzI3YmItMTMyMy00YjE1LTliYTgtN2Q4M2QzZDE5MTlhXkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'Downfall', '8.2', '2004', '301924', 'Oliver Hirschbiegel', 'Bruno Ganz,Alexandra Maria Lara,Ulrich Matthes', '2h36min', 'Biography,Drama,History', 'In April of 1945, Germany stands at the brink of defeat with the Soviet Armies closing in from the west and south. In Berlin, capital of the Third Reich, Adolf Hitler proclaims that Germany will still achieve victory and orders his Generals and advisers to fight to the last man. \"Downfall\" explores these final days of the Reich, where senior German leaders (such as Himmler and Goring) began defect', 'www.youtube.com/embed/Bp1RXmM1-60');
