INSERT INTO `movie_processor_movie` VALUES (124, 'https://m.media-amazon.com/images/M/MV5BYjRmODkzNDItMTNhNi00YjJlLTg0ZjAtODlhZTM0YzgzYThlXkEyXkFqcGdeQXVyNzQ1ODk3MTQ@.jpg', 'Raging Bull', '8.2', '1980', '284828', 'Martin Scorsese', 'Robert De Niro,Cathy Moriarty,Joe Pesci', '2h9min', 'Biography,Drama,Sport', 'When Jake LaMotta steps into a boxing ring and obliterates his opponent, he\'s a prizefighter. But when he treats his family and friends the same way, he\'s a ticking time bomb, ready to go off at any moment. Though LaMotta wants his family\'s love, something always seems to come between them. Perhaps it\'s his violent bouts of paranoia and jealousy. This kind of rage helped make him a champ, but in r', 'www.youtube.com/embed/yUp6d79WRVI');
