INSERT INTO `movie_processor_movie` VALUES (130, 'https://m.media-amazon.com/images/M/MV5BNTdiOTQ0YmUtOGE3YS00NDg5LWI3YTEtNDAxZmE0MzRmZWM5L2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@.jpg', 'My Neighbor Totoro', '8.2', '1988', '235629', 'Hayao Miyazaki', 'Hitoshi Takagi,Noriko Hidaka,Chika Sakamoto', '1h26min', 'Animation,Family,Fantasy', 'Two young girls, 10-year-old Satsuki and her 4-year-old sister Mei, move into a house in the country with their father to be closer to their hospitalized mother. Satsuki and Mei discover that the nearby forest is inhabited by magical creatures called Totoros (pronounced toe-toe-ro). They soon befriend these Totoros, and have several magical adventures.', 'www.youtube.com/embed/92a7Hj0ijLs');
