INSERT INTO `movie_processor_movie` VALUES (133, 'https://m.media-amazon.com/images/M/MV5BZDBjZTM4ZmEtOTA5ZC00NTQzLTkyNzYtMmUxNGU2YjI5YjU5L2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@.jpg', 'Ran', '8.2', '1985', '98641', 'Akira Kurosawa', 'Tatsuya Nakadai,Akira Terao,Jinpachi Nezu', '2h42min', 'Action,Drama', 'Japanese warlord Hidetori Ichimonji decides the time has come to retire and divide his fiefdom among his three sons. His eldest and middle sons - Taro and Jiro - agree with his decision and promise to support him for his remaining days. The youngest son Saburo disagrees with all of them arguing that there is little likelihood the three brothers will remain united. Insulted by his son\'s brashness, ', 'www.youtube.com/embed/AbbfDntoRRk');
