INSERT INTO `movie_processor_movie` VALUES (135, 'https://m.media-amazon.com/images/M/MV5BMTgwNTI3OTczOV5BMl5BanBnXkFtZTcwMTM3MTUyMw@@.jpg', 'The Secret in Their Eyes', '8.2', '2009', '171211', 'Juan José Campanella', 'Ricardo Darín,Soledad Villamil,Pablo Rago', '2h9min', 'Drama,Mystery,Romance', 'In 1999, retired Argentinian federal justice agent Benjamín Espósito is writing a novel, using an old closed case as the source material. That case is the brutal rape and murder of Liliana Coloto. In addition to seeing the extreme grief of the victim\'s husband Ricardo Morales, Benjamín, his assistant Pablo Sandoval, and newly hired department chief Irene Menéndez-Hastings were personally affected ', 'www.youtube.com/embed/N3b0PFCrayE');
