INSERT INTO `movie_processor_movie` VALUES (138, 'https://m.media-amazon.com/images/M/MV5BMzcwYWFkYzktZjAzNC00OGY1LWI4YTgtNzc5MzVjMDVmNjY0XkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'A Beautiful Mind', '8.2', '2001', '763199', 'Ron Howard', 'Russell Crowe,Ed Harris,Jennifer Connelly', '2h15min', 'Biography,Drama', 'From the heights of notoriety to the depths of depravity, John Forbes Nash, Jr. experienced it all. A mathematical genius, he made an astonishing discovery early in his career and stood on the brink of international acclaim. But the handsome and arrogant Nash soon found himself on a painful and harrowing journey of self-discovery. After many years of struggle, he eventually triumphed over his trag', 'www.youtube.com/embed/YWwAOutgWBQ');
INSERT INTO `movie_processor_movie` VALUES (139, 'https://m.media-amazon.com/images/M/MV5BMTAyN2JmZmEtNjAyMy00NzYwLThmY2MtYWQ3OGNhNjExMmM4XkEyXkFqcGdeQXVyNDk3NzU2MTQ@.jpg', 'Lock, Stock and Two Smoking Barrels', '7.6', '1998', '489586', 'Guy Ritchie', 'Jason Flemyng,Dexter Fletcher,Nick Moran', '1h47min', 'Comedy,Crime', 'Four Jack-the-lads find themselves heavily - seriously heavily - in debt to an East End hard man and his enforcers after a crooked card game. Overhearing their neighbours in the next flat plotting to hold up a group of out-of-their-depth drug growers, our heros decide to stitch up the robbers in turn. In a way the confusion really starts when a pair of antique double-barrelled shotguns go missing ', 'www.youtube.com/embed/Y8MXn5No1Jc');
INSERT INTO `movie_processor_movie` VALUES (140, 'https://m.media-amazon.com/images/M/MV5BMTcxOWYzNDYtYmM4YS00N2NkLTk0NTAtNjg1ODgwZjAxYzI3XkEyXkFqcGdeQXVyNTA4NzY1MzY@.jpg', 'Casino', '8.2', '1995', '410203', 'Martin Scorsese', 'Robert De Niro,Sharon Stone,Joe Pesci', '2h58min', 'Crime,Drama', 'This Martin Scorsese film depicts the Janus-like quality of Las Vegas--it has a glittering, glamorous face, as well as a brutal, cruel one. Ace Rothstein and Nicky Santoro, mobsters who move to Las Vegas to make their mark, live and work in this paradoxical world. Seen through their eyes, each as a foil to the other, the details of mob involvement in the casinos of the 1970\'s and \'80\'s are reveale', 'www.youtube.com/embed/EJXDMwGWhoA');
