INSERT INTO `movie_processor_movie` VALUES (169, 'https://m.media-amazon.com/images/M/MV5BOWFlNzZhYmYtYTI5YS00MDQyLWIyNTUtNTRjMWUwNTEzNjA0XkEyXkFqcGdeQXVyNjUwNzk3NDc@.jpg', 'Cool Hand Luke', '8.1', '1967', '147244', 'Stuart Rosenberg', 'Paul Newman,George Kennedy,Strother Martin', '2h6min', 'Crime,Drama', 'Luke Jackson is a cool, gutsy prisoner in a Southern chain gang, who, while refusing to buckle under to authority, keeps escaping and being recaptured. The prisoners admire Luke because, as Dragline explains it, \"You\'re an original, that\'s what you are!\" Nevertheless, the camp staff actively works to crush Luke until he finally breaks.', 'www.youtube.com/embed/ofxtDrRVQY4');
