INSERT INTO `movie_processor_movie` VALUES (194, 'https://m.media-amazon.com/images/M/MV5BZGJjYmIzZmQtNWE4Yy00ZGVmLWJkZGEtMzUzNmQ4ZWFlMjRhXkEyXkFqcGdeQXVyMTMxODk2OTU@.jpg', 'Hotel Rwanda', '8.1', '2004', '311262', 'Terry George', 'Don Cheadle,Sophie Okonedo,Joaquin Phoenix', '2h1min', 'Biography,Drama,History', '1994. In Rwanda, the classification of the native population into Hutus and Tutsis, arbitrarily done by the colonial Belgians, is now ingrained within Rwandan mentality despite the Rwandan independence. Despite the Belgians having placed the Tutsis in a higher position during the Belgian rule, they have placed the majority Hutus in power after independence. Paul Rusesabagina, a Hutu married to a T', 'www.youtube.com/embed/qZzfxL90100');
