INSERT INTO `movie_processor_movie` VALUES (204, 'https://m.media-amazon.com/images/M/MV5BNzE4NDg5OWMtMzg3NC00ZDRjLTllMDMtZTRjNWZmNjBmMGZlXkEyXkFqcGdeQXVyMTMxODk2OTU@.jpg', 'Hachi: A Dog\'s Tale', '8.1', '2009', '220582', 'Lasse Hallström', 'Richard Gere,Joan Allen,Cary-Hiroyuki Tagawa', '1h33min', 'Drama,Family', 'Commuting by train, music professor Parker Wilson finds an Akita puppy, whose cage broke unnoticed during shipping, leaving his destination unknown, and since the station can\'t care for it and the dog catcher warns even such cute ones may not be adopted in the two weeks allowed, he kindly takes it home. His bossy, jealous wife Cate initially makes Parker swear it won\'t stay, but by the time its\' c', 'www.youtube.com/embed/TIl2o1hm1F4');
INSERT INTO `movie_processor_movie` VALUES (205, 'https://m.media-amazon.com/images/M/MV5BMjIyOTM5OTIzNV5BMl5BanBnXkFtZTgwMDkzODE2NjE@.jpg', 'Spotlight', '8.1', '2015', '359784', 'Tom McCarthy', 'Mark Ruffalo,Michael Keaton,Rachel McAdams', '2h9min', 'Crime,Drama', 'When the Boston Globe\'s tenacious \"Spotlight\" team of reporters delves into allegations of abuse in the Catholic Church, their year-long investigation uncovers a decades-long cover-up at the highest levels of Boston\'s religious, legal, and government establishment, touching off a wave of revelations around the world.', 'www.youtube.com/embed/EwdCIpbTN5g');
