INSERT INTO `movie_processor_movie` VALUES (207, 'https://m.media-amazon.com/images/M/MV5BMWJhOTg5MWQtYTJjMi00YmFkLTg4ODgtYmU2YWVhODQ4ZDM3XkEyXkFqcGdeQXVyMTAwMzUyOTc@.jpg', 'Amores Perros', '8.1', '2000', '205664', 'Alejandro G. Iñárritu', 'Emilio Echevarría,Gael García Bernal,Goya Toledo', '2h34min', 'Drama,Thriller', 'On the brink of the new Millennium in the bustling City of Mexico, one horrible car accident intertwines inextricably the lives of three perfect strangers. Octavio, a rebellious adolescent who is secretly in love with his sister-in-law, dreams of escaping his miserable life, and for this reason, he enters reluctantly the obscure world of dog fighting with his lethal dog Cofi. And then unexpectedly', 'www.youtube.com/embed/A5HTBYR7m0o');
INSERT INTO `movie_processor_movie` VALUES (208, 'https://m.media-amazon.com/images/M/MV5BMTY5MzYzNjc5NV5BMl5BanBnXkFtZTYwNTUyNTc2.jpg', 'Catch Me If You Can', '8.1', '2002', '708860', 'Steven Spielberg', 'Leonardo DiCaprio,Tom Hanks,Christopher Walken', '2h21min', 'Biography,Crime,Drama', 'New Rochelle, the 1960s. High schooler Frank Abagnale Jr. idolizes his father, who\'s in trouble with the IRS. When his parents separate, Frank runs away to Manhattan with $25 in his checking account, vowing to regain dad\'s losses and get his parents back together. Just a few years later, the FBI tracks him down in France; he\'s extradited, tried, and jailed for passing more than $4,000,000 in bad c', 'www.youtube.com/embed/xas1UyTiVUw');
INSERT INTO `movie_processor_movie` VALUES (209, 'https://m.media-amazon.com/images/M/MV5BMGM4M2Q5N2MtNThkZS00NTc1LTk1NTItNWEyZjJjNDRmNDk5XkEyXkFqcGdeQXVyMjA0MDQ0Mjc@.jpg', 'The Princess Bride', '8.1', '1987', '354988', 'Rob Reiner', 'Cary Elwes,Mandy Patinkin,Robin Wright', '1h38min', 'Adventure,Family,Fantasy', 'An elderly man reads the book \"The Princess Bride\" to his sick and thus currently bedridden adolescent grandson, the reading of the book which has been passed down within the family for generations. The grandson is sure he won\'t like the story, with a romance at its core, he preferring something with lots of action and \"no kissing\". But the grandson is powerless to stop his grandfather, whose feel', 'www.youtube.com/embed/O3CIXEAjcc8');
INSERT INTO `movie_processor_movie` VALUES (210, 'https://m.media-amazon.com/images/M/MV5BODJiNmUzYmQtZTNhNS00NjY0LThmYjMtOTliOTM1NTdkYzY1XkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'Nausicaä of the Valley of the Wind', '8.1', '1984', '126794', 'Hayao Miyazaki', 'Sumi Shimamoto,Mahito Tsujimura,Hisako Kyôda', '1h57min', 'Animation,Adventure,Fantasy', 'An animated fantasy-adventure. Set one thousand years from now, the Earth is ravaged by pollution and war. In the Valley of the Wind lives Nausicaä, Princess of her people. Their land borders on a toxic jungle, filled with dangerous over-sized insects. Meanwhile, two nearby nations are bitterly engaged in a war and the Valley of the Wind is stuck in the middle.', 'www.youtube.com/embed/6zhLBe319KE');
INSERT INTO `movie_processor_movie` VALUES (211, 'https://m.media-amazon.com/images/M/MV5BMjIyZGU4YzUtNDkzYi00ZDRhLTljYzctYTMxMDQ4M2E0Y2YxXkEyXkFqcGdeQXVyNTIzOTk5ODM@.jpg', 'Harry Potter and the Deathly Hallows: Part 2', '8.1', '2011', '684178', 'David Yates', 'Daniel Radcliffe,Emma Watson,Rupert Grint', '2h10min', 'Adventure,Drama,Fantasy', 'Harry, Ron, and Hermione continue their quest of finding and destroying the Dark Lord\'s three remaining Horcruxes, the magical items responsible for his immortality. But as the mystical Deathly Hallows are uncovered, and Voldemort finds out about their mission, the biggest battle begins and life as they know it will never be the same again.', 'www.youtube.com/embed/mObK5XD8udk');
INSERT INTO `movie_processor_movie` VALUES (212, 'https://m.media-amazon.com/images/M/MV5BM2I3OGU1YmQtNjIyOC00OGYzLWFkOTgtOGIyMDVlNmE2M2VmXkEyXkFqcGdeQXVyODE5NzE3OTE@.jpg', 'Rang De Basanti', '8.2', '2006', '99563', 'Rakeysh Omprakash Mehra', 'Aamir Khan,Soha Ali Khan,Siddharth', '2h37min', 'Comedy,Drama', 'Sue comes to India to make a film on Indian revolutionaries.She is helped by her friend Sonia who introduces her to her friends Karan,Aslam,Sukhi and their head DJ.Sonia\'s fiance Lt Ajay Rathod also joins the gang when in town.Their gang always gets in trouble with a political member Laxman who opposes their western culture.After many auditions Sue decides to caste DJ and his friend\'s in her film.', 'www.youtube.com/embed/QHhnhqxB4E8');
INSERT INTO `movie_processor_movie` VALUES (213, 'https://m.media-amazon.com/images/M/MV5BMTkyMTM2NDk5Nl5BMl5BanBnXkFtZTgwNzY1NzEyMDE@.jpg', 'Butch Cassidy and the Sundance Kid', '8.1', '1969', '185717', 'George Roy Hill', 'Paul Newman,Robert Redford,Katharine Ross', '1h50min', 'Biography,Crime,Drama', 'Butch and Sundance are the two leaders of the Hole-in-the-Wall Gang. Butch is all ideas, Sundance is all action and skill. The west is becoming civilized, and when Butch and Sundance rob a train once too often, a special posse begins trailing them no matter where they run. Over rocks, through towns, across rivers, the group is always just behind them. When they finally escape through sheer luck, B', 'www.youtube.com/embed/YdJW2UxvSFQ');
INSERT INTO `movie_processor_movie` VALUES (214, 'https://m.media-amazon.com/images/M/MV5BMTY5MDMzODUyOF5BMl5BanBnXkFtZTcwMTQ3NTMyNA@@.jpg', 'Rocky', '8.1', '1976', '467954', 'John G. Avildsen', 'Sylvester Stallone,Talia Shire,Burt Young', '', 'Drama,Sport', 'Rocky Balboa is a struggling boxer trying to make the big time, working as a debt collector for a pittance. When heavyweight champion Apollo Creed visits Philadelphia, his managers want to set up an exhibition match between Creed and a struggling boxer, touting the fight as a chance for a \"nobody\" to become a \"somebody\". The match is supposed to be easily won by Creed, but someone forgot to tell R', 'www.youtube.com/embed/7RYpJAUMo2M');
INSERT INTO `movie_processor_movie` VALUES (215, 'https://m.media-amazon.com/images/M/MV5BNmY0MWY2NDctZDdmMi00MjA1LTk0ZTQtZDMyZTQ1NTNlYzVjXkEyXkFqcGdeQXVyMjUzOTY1NTc@.jpg', 'Barry Lyndon', '8.1', '1975', '130859', 'Stanley Kubrick', 'Ryan O\'Neal,Marisa Berenson,Patrick Magee', '3h5min', 'Adventure,Drama,History', 'In the Eighteenth Century, in a small village in Ireland, Redmond Barry is a young farm boy in love with his cousin Nora Brady. When Nora gets engaged to the British Captain John Quin, Barry challenges him to a duel of pistols. He wins and escapes to Dublin but is robbed on the road. Without an alternative, Barry joins the British Army to fight in the Seven Years War. He deserts and is forced to j', 'www.youtube.com/embed/9lzSoKOs1fc');
INSERT INTO `movie_processor_movie` VALUES (216, 'https://m.media-amazon.com/images/M/MV5BMTY1NTI0ODUyOF5BMl5BanBnXkFtZTgwNTEyNjQ0MDE@.jpg', 'Monsters, Inc.', '8.1', '2001', '731051', 'Pete Docter', 'Billy Crystal,John Goodman,Mary Gibbs', '1h32min', 'Animation,Adventure,Comedy', 'A city of monsters with no humans called Monstropolis centers around the city\'s power company, Monsters, Inc. The lovable, confident, tough, furry blue behemoth-like giant monster named James P. Sullivan (better known as Sulley) and his wisecracking best friend, short, green cyclops monster Mike Wazowski, discover what happens when the real world interacts with theirs in the form of a 2-year-old b', 'www.youtube.com/embed/cvOQeozL4S0');
INSERT INTO `movie_processor_movie` VALUES (217, 'https://m.media-amazon.com/images/M/MV5BNzJiOGI2MjctYjUyMS00ZjkzLWE2ZmUtOTg4NTZkOTNhZDc1L2ltYWdlXkEyXkFqcGdeQXVyNjc1NTYyMjg@.jpg', 'The Grapes of Wrath', '8.1', '1940', '80214', 'John Ford', 'Henry Fonda,Jane Darwell,John Carradine', '2h9min', 'Drama,History', 'The Joad clan, introduced to the world in John Steinbeck\'s iconic novel, is looking for a better life in California. After their drought-ridden farm is seized by the bank, the family -- led by just-paroled son Tom -- loads up a truck and heads West. On the road, beset by hardships, the Joads meet dozens of other families making the same trek and holding onto the same dream. Once in California, how', 'www.youtube.com/embed/jdqlGY6K1DI');
INSERT INTO `movie_processor_movie` VALUES (218, 'https://m.media-amazon.com/images/M/MV5BOGYwYWNjMzgtNGU4ZC00NWQ2LWEwZjUtMzE1Zjc3NjY3YTU1XkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'Dead Poets Society', '8.1', '1989', '364060', 'Peter Weir', 'Robin Williams,Robert Sean Leonard,Ethan Hawke', '2h8min', 'Comedy,Drama', 'Painfully shy Todd Anderson has been sent to the school where his popular older brother was valedictorian. His roommate, Neil Perry, although exceedingly bright and popular, is very much under the thumb of his overbearing father. The two, along with their other friends, meet Professor Keating, their new English teacher, who tells them of the Dead Poets Society, and encourages them to go against th', 'www.youtube.com/embed/4lj185DaZ_o');
INSERT INTO `movie_processor_movie` VALUES (219, 'https://m.media-amazon.com/images/M/MV5BZjIwNGM1ZTUtOThjYS00NDdiLTk2ZDYtNGY5YjJkNzliM2JjL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMDI2NDg0NQ@@.jpg', 'The Maltese Falcon', '8.1', '1941', '139373', 'John Huston', 'Humphrey Bogart,Mary Astor,Gladys George', '1h40min', 'Film-Noir,Mystery', 'Spade and Archer is the name of a San Francisco detective agency. That\'s for Sam Spade and Miles Archer. The two men are partners, but Sam doesn\'t like Miles much. A knockout, who goes by the name of Miss Wonderly, walks into their office; and by that night everything\'s changed. Miles is dead. And so is a man named Floyd Thursby. It seems Miss Wonderly is surrounded by dangerous men. There\'s Joel ', 'www.youtube.com/embed/3a9YU1SVbSE');
INSERT INTO `movie_processor_movie` VALUES (220, 'https://m.media-amazon.com/images/M/MV5BYTViNzMxZjEtZGEwNy00MDNiLWIzNGQtZDY2MjQ1OWViZjFmXkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Terminator', '8.0', '1984', '722356', 'James Cameron', 'Arnold Schwarzenegger,Linda Hamilton,Michael Biehn', '1h47min', 'Action,Sci-Fi', 'A cyborg is sent from the future on a deadly mission. He has to kill Sarah Connor, a young woman whose life will have a great significance in years to come. Sarah has only one protector - Kyle Reese - also sent from the future. The Terminator uses his exceptional intelligence and strength to find Sarah, but is there any way to stop the seemingly indestructible cyborg ?', 'www.youtube.com/embed/k64P4l2Wmeg');
INSERT INTO `movie_processor_movie` VALUES (221, 'https://m.media-amazon.com/images/M/MV5BMzJiZDRmOWUtYjE2MS00Mjc1LTg1ZDYtNTQxYWJkZTg1OTM4XkEyXkFqcGdeQXVyNjUwNzk3NDc@.jpg', 'Gandhi', '8.1', '1982', '205822', 'Richard Attenborough', 'Ben Kingsley,John Gielgud,Rohini Hattangadi', '3h11min', 'Biography,Drama,History', 'In 1893, Mohandas K. Gandhi is thrown off a South African train for being an Indian and traveling in a first class compartment. Gandhi realizes that the laws are biased against Indians and decides to start a non-violent protest campaign for the rights of all Indians in South Africa. After numerous arrests and the unwanted attention of the world, the government finally relents by recognizing rights', 'www.youtube.com/embed/4pENM42-QB8');
INSERT INTO `movie_processor_movie` VALUES (222, 'https://m.media-amazon.com/images/M/MV5BZjZlZDlkYTktMmU1My00ZDBiLWFlNjEtYTBhNjVhOTM4ZjJjXkEyXkFqcGdeQXVyMTMxODk2OTU@.jpg', 'Donnie Darko', '8.1', '2001', '692670', 'Richard Kelly', 'Jake Gyllenhaal,Jena Malone,Mary McDonnell', '1h53min', 'Drama,Sci-Fi,Thriller', 'Donnie Darko doesn\'t get along too well with his family, his teachers, and his classmates; but he does manage to find a sympathetic friend in Gretchen, who agrees to date him. He has a compassionate psychiatrist, who discovers hypnosis is the means to unlock hidden secrets. His other companion may not be a true ally. Donnie has a friend named Frank, a large bunny which only Donnie can see. When an', 'www.youtube.com/embed/bzLn8sYeM9o');
INSERT INTO `movie_processor_movie` VALUES (223, 'https://m.media-amazon.com/images/M/MV5BOTc1OGQzMjMtNTkxYy00OTBlLWJmZjMtYWQ4NzZjNDE1YjkxXkEyXkFqcGdeQXVyMDUyOTUyNQ@@.jpg', 'Diabolique', '8.1', '1955', '56018', 'Henri-Georges Clouzot', 'Simone Signoret,Véra Clouzot,Paul Meurisse', '1h57min', 'Crime,Drama,Horror', 'The wife and mistress of a sadistic boarding school headmaster plot to kill him. They drown him in the bathtub and dump the body in the school\'s filthy swimming pool... but when the pool is drained, the body has disappeared - and subsequent reported sightings of the headmaster slowly drive his \'killers\' (and the audience) up the wall with almost unbearable suspense...', 'www.youtube.com/embed/QyQZHWC83GA');
INSERT INTO `movie_processor_movie` VALUES (224, 'https://m.media-amazon.com/images/M/MV5BNDNiOTA5YjktY2Q0Ni00ODgzLWE5MWItNGExOWRlYjY2MjBlXkEyXkFqcGdeQXVyNjQ2MjQ5NzM@.jpg', 'La Haine', '8.1', '1995', '130760', 'Mathieu Kassovitz', 'Vincent Cassel,Hubert Koundé,Saïd Taghmaoui', '1h38min', 'Crime,Drama', 'The film follows three young men and their time spent in the French suburban \"ghetto,\" over a span of twenty-four hours. Vinz, a Jew, Saïd, an Arab, and Hubert, a black boxer, have grown up in these French suburbs where high levels of diversity coupled with the racist and oppressive police force have raised tensions to a critical breaking point. During the riots that took place a night before, a p', 'www.youtube.com/embed/NWrXQ8LsKYg');
INSERT INTO `movie_processor_movie` VALUES (225, 'https://m.media-amazon.com/images/M/MV5BN2NhZjk1ZGEtNzAxNy00ZWI4LWI5ZDItYTVmY2JmZDg2M2U4XkEyXkFqcGdeQXVyNTQ0NTUxOTA@.jpg', 'The Handmaiden', '8.1', '2016', '76256', 'Chan-wook Park', 'Min-hee Kim,Jung-woo Ha,Jin-Woong Cho', '2h25min', 'Drama,Romance,Thriller', '1930s Korea, in the period of Japanese occupation, a new girl (Sookee) is hired as a handmaiden to a Japanese heiress (Hideko) who lives a secluded life on a large countryside estate with her domineering Uncle (Kouzuki). But the maid has a secret. She is a pickpocket recruited by a swindler posing as a Japanese Count to help him seduce the Lady to elope with him, rob her of her fortune, and lock h', 'www.youtube.com/embed/whldChqCsYk');
INSERT INTO `movie_processor_movie` VALUES (226, 'https://m.media-amazon.com/images/M/MV5BYjZjODRlMjQtMjJlYy00ZDBjLTkyYTQtZGQxZTk5NzJhYmNmXkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'In the Mood for Love', '8.1', '2000', '104287', 'Kar-Wai Wong', 'Tony Chiu-Wai Leung,Maggie Cheung,Ping Lam Siu', '1h38min', 'Drama,Romance', 'Set in Hong Kong, 1962, Chow Mo-Wan is a newspaper editor who moves into a new building with his wife. At the same time, Su Li-zhen, a beautiful secretary and her executive husband also move in to the crowded building. With their spouses often away, Chow and Li-zhen spend most of their time together as friends. They have everything in common from noodle shops to martial arts. Soon, they are shocke', 'www.youtube.com/embed/dWVDZ98AFhI');
INSERT INTO `movie_processor_movie` VALUES (227, 'https://m.media-amazon.com/images/M/MV5BZWIxNzM5YzQtY2FmMS00Yjc3LWI1ZjUtNGVjMjMzZTIxZTIxXkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'Groundhog Day', '8.0', '1993', '536792', 'Harold Ramis', 'Bill Murray,Andie MacDowell,Chris Elliott', '1h41min', 'Comedy,Fantasy,Romance', 'A weather man is reluctantly sent to cover a story about a weather forecasting \"rat\" (as he calls it). This is his fourth year on the story, and he makes no effort to hide his frustration. On awaking the \'following\' day he discovers that it\'s Groundhog Day again, and again, and again. First he uses this to his advantage, then comes the realisation that he is doomed to spend the rest of eternity in', 'www.youtube.com/embed/GncQtURdcE4');
INSERT INTO `movie_processor_movie` VALUES (228, 'https://m.media-amazon.com/images/M/MV5BNjUyMTc4MDExMV5BMl5BanBnXkFtZTgwNDg0NDIwMjE@.jpg', 'The Wizard of Oz', '8.0', '1939', '349278', 'Victor Fleming', 'Judy Garland,Frank Morgan,Ray Bolger', '1h42min', 'Adventure,Family,Fantasy', 'In this charming film based on the popular L. Frank Baum stories, Dorothy and her dog Toto are caught in a tornado\'s path and somehow end up in the land of Oz. Here she meets some memorable friends and foes in her journey to meet the Wizard of Oz who everyone says can help her return home and possibly grant her new friends their goals of a brain, heart and courage.', 'www.youtube.com/embed/H_3T4DGw10U');
INSERT INTO `movie_processor_movie` VALUES (229, 'https://m.media-amazon.com/images/M/MV5BMTM5OTMyMjIxOV5BMl5BanBnXkFtZTcwNzU4MjIwNQ@@.jpg', 'The Help', '8.1', '2011', '389298', 'Tate Taylor', 'Emma Stone,Viola Davis,Octavia Spencer', '2h26min', 'Drama', 'Set in Mississippi during the 1960s, Skeeter (Stone) is a southern society girl who returns from college determined to become a writer, but turns her friends\' lives -- and a Mississippi town -- upside down when she decides to interview the black women who have spent their lives taking care of prominent southern families. Aibileen (Davis), Skeeter\'s best friend\'s housekeeper, is the first to open u', 'www.youtube.com/embed/aT9eWGjLv6s');
INSERT INTO `movie_processor_movie` VALUES (230, 'https://m.media-amazon.com/images/M/MV5BMmVmODY1MzEtYTMwZC00MzNhLWFkNDMtZjAwM2EwODUxZTA5XkEyXkFqcGdeQXVyNTAyODkwOQ@@.jpg', 'Jaws', '8.0', '1975', '505417', 'Steven Spielberg', 'Roy Scheider,Robert Shaw,Richard Dreyfuss', '2h4min', 'Adventure,Drama,Thriller', 'It\'s a hot summer on Amity Island, a small community whose main business is its beaches. When new Sheriff Martin Brody discovers the remains of a shark attack victim, his first inclination is to close the beaches to swimmers. This doesn\'t sit well with Mayor Larry Vaughn and several of the local businessmen. Brody backs down to his regret as that weekend a young boy is killed by the predator. The ', 'www.youtube.com/embed/U1fu_sA7XhE');
INSERT INTO `movie_processor_movie` VALUES (231, 'https://m.media-amazon.com/images/M/MV5BZjllMDcyY2YtZDc5Zi00NDRlLThkZmItMTJhOWZmYjM0NmQyXkEyXkFqcGdeQXVyNTc1NDM0NDU@.jpg', 'The Nights of Cabiria', '8.1', '1957', '38341', 'Federico Fellini', 'Giulietta Masina,François Périer,Franca Marzi', '1h50min', 'Drama', 'Rome, 1957. A woman, Cabiria, is robbed and left to drown by her boyfriend, Giorgio. Rescued, she resumes her life and tries her best to find happiness in a cynical world. Even when she thinks her struggles are over and she has found happiness and contentment, things may not be what they seem.', 'www.youtube.com/embed/HHSw7jxYCOk');
INSERT INTO `movie_processor_movie` VALUES (232, 'https://m.media-amazon.com/images/M/MV5BMTQ1MjAwNTM5Ml5BMl5BanBnXkFtZTYwNDM0MTc3.jpg', 'Before Sunset', '8.1', '2004', '205811', 'Richard Linklater', 'Ethan Hawke,Julie Delpy,Vernon Dobtcheff', '1h20min', 'Drama,Romance', 'Early thirty-something American Jesse Wallace is in a Paris bookstore, the last stop on a tour to promote his best selling book, This Time. Although he is vague to reporters about the source material for the book, it is about his chance encounter nine years earlier on June 15-16, 1994 with a Parisienne named Celine, and the memorable and romantic day and evening they spent together in Vienna. At t', 'www.youtube.com/embed/oI3UuneLcyU');
INSERT INTO `movie_processor_movie` VALUES (233, 'https://m.media-amazon.com/images/M/MV5BM2RjMmU3ZWItYzBlMy00ZmJkLWE5YzgtNTVkODdhOWM3NGZhXkEyXkFqcGdeQXVyNDA5Mjg5MjA@.jpg', 'Paris, Texas', '8.1', '1984', '73476', 'Wim Wenders', 'Harry Dean Stanton,Nastassja Kinski,Dean Stockwell', '2h25min', 'Drama', 'A man wanders out of the desert after a four year absence. His brother finds him, and together they return to L.A. to reunite the man with his young son. Soon after, he and the boy set out to locate the mother of the child, who left shortly after the man disappeared.', 'www.youtube.com/embed/9e590FeeGCM');
INSERT INTO `movie_processor_movie` VALUES (234, 'https://m.media-amazon.com/images/M/MV5BNTg0NmI1ZGQtZTUxNC00NTgxLThjMDUtZmRlYmEzM2MwOWYwXkEyXkFqcGdeQXVyMzM4MjM0Nzg@.jpg', 'Castle in the Sky', '8.1', '1986', '126264', 'Hayao Miyazaki', 'Anna Paquin,James Van Der Beek,Cloris Leachman', '2h5min', 'Animation,Adventure,Drama', 'A young boy stumbles into a mysterious girl who floats down from the sky. The girl, Sheeta, was chased by pirates, army and government secret agents. In saving her life, they begin a high flying adventure that goes through all sorts of flying machines, eventually searching for Sheeta\'s identity in a floating castle of a lost civilization.', 'www.youtube.com/embed/McM0_YHDm5A');
INSERT INTO `movie_processor_movie` VALUES (235, 'https://m.media-amazon.com/images/M/MV5BMTAwMjU5OTgxNjZeQTJeQWpwZ15BbWU4MDUxNDYxODEx.jpg', 'Guardians of the Galaxy', '8.1', '2014', '925546', 'James Gunn', 'Chris Pratt,Vin Diesel,Bradley Cooper', '2h1min', 'Action,Adventure,Comedy', 'After stealing a mysterious orb in the far reaches of outer space, Peter Quill from Earth is now the main target of a manhunt led by the villain known as Ronan the Accuser. To help fight Ronan and his team and save the galaxy from his power, Quill creates a team of space heroes known as the \"Guardians of the Galaxy\" to save the galaxy.', 'www.youtube.com/embed/d96cjJhvlMA');
INSERT INTO `movie_processor_movie` VALUES (236, 'https://m.media-amazon.com/images/M/MV5BY2RmNTRjYzctODI4Ni00MzQyLWEyNTAtNjU0N2JkMTNhNjJkXkEyXkFqcGdeQXVyNjU0OTQ0OTY@.jpg', 'The Best Years of Our Lives', '8.1', '1946', '52869', 'William Wyler', 'Myrna Loy,Dana Andrews,Fredric March', '2h50min', 'Drama,Romance,War', 'The story concentrates on the social re-adjustment of three World War II servicemen, each from a different station of society. Al Stephenson returns to an influential banking position, but finds it hard to reconcile his loyalties to ex-servicemen with new commercial realities. Fred Derry is an ordinary working man who finds it difficult to hold down a job or pick up the threads of his marriage. Ha', 'www.youtube.com/embed/ZsWKL5PLnjI');
INSERT INTO `movie_processor_movie` VALUES (237, 'https://m.media-amazon.com/images/M/MV5BNGYyZGM5MGMtYTY2Ni00M2Y1LWIzNjQtYWUzM2VlNGVhMDNhXkEyXkFqcGdeQXVyMTMxODk2OTU@.jpg', 'Pirates of the Caribbean: The Curse of the Black Pearl', '8.0', '2003', '956678', 'Gore Verbinski', 'Johnny Depp,Geoffrey Rush,Orlando Bloom', '2h23min', 'Action,Adventure,Fantasy', 'This swash-buckling tale follows the quest of Captain Jack Sparrow, a savvy pirate, and Will Turner, a resourceful blacksmith, as they search for Elizabeth Swann. Elizabeth, the daughter of the governor and the love of Will\'s life, has been kidnapped by the feared Captain Barbossa. Little do they know, but the fierce and clever Barbossa has been cursed. He, along with his large crew, are under an ', 'www.youtube.com/embed/naQr0uTrH_s');
INSERT INTO `movie_processor_movie` VALUES (238, 'https://m.media-amazon.com/images/M/MV5BMTUwNjUxMTM4NV5BMl5BanBnXkFtZTgwODExMDQzMTI@.jpg', 'Beauty and the Beast', '7.2', '2017', '233542', 'Bill Condon', 'Emma Watson,Dan Stevens,Luke Evans', '2h9min', 'Family,Fantasy,Musical', 'Disney\'s animated classic takes on a new form, with a widened mythology and an all-star cast. A young prince, imprisoned in the form of a beast, can be freed only by true love. What may be his only opportunity arrives when he meets Belle, the only human girl to ever visit the castle since it was enchanted.', 'www.youtube.com/embed/e3Nl_TCQXuw');
INSERT INTO `movie_processor_movie` VALUES (239, 'https://m.media-amazon.com/images/M/MV5BMTQ2MDMwNjEwNV5BMl5BanBnXkFtZTgwOTkxMzI0MzE@.jpg', 'Song of the Sea', '8.1', '2014', '43320', 'Tomm Moore', 'David Rawle,Brendan Gleeson,Lisa Hannigan', '1h33min', 'Animation,Adventure,Drama', 'Saoirse is a child who is the last of the selkies, women in Irish and Scottish legends who transform from seals into people. She escapes from her grandmother\'s home to journey to the sea and free fairy creatures trapped in the modern world.', 'www.youtube.com/embed/B7ZIugIa8KI');
INSERT INTO `movie_processor_movie` VALUES (240, 'https://m.media-amazon.com/images/M/MV5BYTg1MmNiMjItMmY4Yy00ZDQ3LThjMzYtZGQ0ZTQzNTdkMGQ1L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@.jpg', 'Three Colors: Red', '8.1', '1994', '79079', 'Krzysztof Kieslowski', 'Irène Jacob,Jean-Louis Trintignant,Frédérique Feder', '1h39min', 'Drama,Mystery,Romance', 'Valentine is a young model living in Geneva. Because of a dog she ran over, she meets a retired judge who spies his neighbours\' phone calls, not for money but to feed his cynicism. The film is the story of relationships between some human beings, Valentine and the judge, but also other people who may not be aware of the relationship they have with Valentine or/and the old judge. Redemption, forgiv', 'www.youtube.com/embed/RPLpbDFQZpg');
INSERT INTO `movie_processor_movie` VALUES (241, 'https://m.media-amazon.com/images/M/MV5BYjhmMGMxZDYtMTkyNy00YWVmLTgyYmUtYTU3ZjcwNTBjN2I1XkEyXkFqcGdeQXVyNzkwMjQ5NzM@.jpg', 'The Exorcist', '8.0', '1973', '329401', 'William Friedkin', 'Ellen Burstyn,Max von Sydow,Linda Blair', '2h2min', 'Horror', 'A visiting actress in Washington, D.C., notices dramatic and dangerous changes in the behavior and physical make-up of her 12-year-old daughter. Meanwhile, a young priest at nearby Georgetown University begins to doubt his faith while dealing with his mother\'s terminal sickness. And, book-ending the story, a frail, elderly priest recognizes the necessity for a show-down with an old demonic enemy.', 'www.youtube.com/embed/5NH3ffAp9aA');
INSERT INTO `movie_processor_movie` VALUES (242, 'https://m.media-amazon.com/images/M/MV5BMTYzOTE2NjkxN15BMl5BanBnXkFtZTgwMDgzMTg0MzE@.jpg', 'PK', '8.2', '2014', '135523', 'Rajkumar Hirani', 'Aamir Khan,Anushka Sharma,Sanjay Dutt', '2h33min', 'Comedy,Drama,Fantasy', 'P. K. is a comedy of ideas about a stranger in the city, who asks questions that no one has asked before. They are innocent, child-like questions, but they bring about catastrophic answers. People who are set in their ways for generations, are forced to reappraise their world when they see it from PK\'s innocent eyes. In the process PK makes loyal friends and powerful foes. Mends broken lives and a', 'www.youtube.com/embed/SOXWc32k4zA');
INSERT INTO `movie_processor_movie` VALUES (243, 'https://m.media-amazon.com/images/M/MV5BM2ZiZTk1ODgtMTZkNS00NTYxLWIxZTUtNWExZGYwZTRjODViXkEyXkFqcGdeQXVyMTE2MzA3MDM@.jpg', 'Akira', '8.1', '1988', '137402', 'Katsuhiro Ôtomo', 'Mitsuo Iwata,Nozomu Sasaki,Mami Koyama', '2h4min', 'Animation,Drama,Sci-Fi', 'Kaneda is a bike gang leader whose close friend Tetsuo gets involved in a government secret project known as Akira. On his way to save Tetsuo, Kaneda runs into a group of anti-government activists, greedy politicians, irresponsible scientists and a powerful military leader. The confrontation sparks off Tetsuo\'s supernatural power leading to bloody death, a coup attempt and the final battle in Toky', 'www.youtube.com/embed/NCmVrn2gnRs');
INSERT INTO `movie_processor_movie` VALUES (244, 'https://m.media-amazon.com/images/M/MV5BMzljMjBhODItYTYyYi00NzMwLTkyZDQtNjQ4MWU0MzhmNDU4XkEyXkFqcGdeQXVyMTA0MjU0Ng@@.jpg', 'Dog Day Afternoon', '8.0', '1975', '216495', 'Sidney Lumet', 'Al Pacino,John Cazale,Penelope Allen', '2h5min', 'Biography,Crime,Drama', 'Based upon a real-life story that happened in the early seventies in which the Chase Manhattan Bank in Gravesend, Brooklyn, was held siege by a bank robber determined to steal enough money for his male lover to undergo a sex change operation. On a hot summer afternoon, the First Savings Bank of Brooklyn is held up by Sonny and Sal, two down-and-out characters. Although the bank manager and female ', 'www.youtube.com/embed/Ne6KMHLTvik');
